import constants from '../constants.json'
import axios from 'axios'
export default function APIGetProfilePicture(name) {

    var config = {
        method: 'get',
        url: constants.photoAddress+`name=${name}&color=000000`,
    };

    return axios(config)
        .then(response => response)
        .catch(function (error) {
            if (error.response) {
                return error.response;
            }
        })
}
